import React from 'react';
import './index.css';

const Button = () => (
  <button className="m-3 w-40 h-20 rounded-lg border-2 border-sky-600 text-white hover:bg-sky-600 transition ease-linear hover:scale-105">
    Remote button
  </button>
);

export default Button;
